import React from "react";
import {
  Link
} from "react-router-dom";

function Classical() {
  return ( <
    div className = "container" >
    <
    div className = "texts" >
    <
    Link to = "/"
    style = {
      {
        textDecoration: "none"
      }
    } >
    <
    div >
    <
    h1 className = "midnight" > Midnight Chill < /h1> <
    /div> <
    /Link> <
    div >
    <
    p className = "choose" > Classical < /p> <
    /div> <
    /div> <
    div className = "gifs" >
    <
    div className = "gif-10" >
    <
    img className = "gif-1"
    src = {
      require("../gifs/3.gif")
    }
    alt = "Class" / >

    <
    p > Lofi < /p> <
    /div> <
    /div> <
    /div>
  );
}

export default Classical;
